class JobInviteResult {
  List<JobInvite>? result;
  String? message;
  bool? success;

  JobInviteResult({this.result, this.message, this.success});

  JobInviteResult.fromJson(Map<String, dynamic> json) {
    if (json['result'] != null) {
      result = <JobInvite>[];
      json['result'].forEach((v) {
        result!.add(new JobInvite.fromJson(v));
      });
    }
    message = json['message'];
    success = json['success'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    if (this.result != null) {
      data['result'] = this.result!.map((v) => v.toJson()).toList();
    }
    data['message'] = this.message;
    data['success'] = this.success;
    return data;
  }
}

class JobInvite {
  String? id;
  String? jobType;
  String? title;
  JobLocation? jobLocation;
  String? description;
  String? startDate;
  String? endDate;
  String? deadline;
  String? ageGroup;
  Height? height;
  String? gender;
  String? lastVisited;
  String? createdAt;
  List<JobDetails>? jobDetails;
  bool? applied;
  bool? hired;
  bool? shortlisted;
  bool? invitation;
  bool? loader;

  JobInvite({
    this.id,
    this.jobType,
    this.title,
    this.jobLocation,
    this.description,
    this.startDate,
    this.endDate,
    this.deadline,
    this.ageGroup,
    this.height,
    this.gender,
    this.lastVisited,
    this.createdAt,
    this.jobDetails,
    this.applied,
    this.hired,
    this.shortlisted,
    this.invitation,
    this.loader,
  });

  JobInvite.fromJson(Map<String, dynamic> json) {
    id = json['_id'];
    jobType = json['jobType'];
    title = json['title'];
    jobLocation = json['jobLocation'] != null
        ? new JobLocation.fromJson(json['jobLocation'])
        : null;
    description = json['description'];
    startDate = json['startDate'];
    endDate = json['endDate'];
    deadline = json['deadline'];
    ageGroup = json['ageGroup'];
    height =
        json['height'] != null ? new Height.fromJson(json['height']) : null;
    gender = json['gender'];
    lastVisited = json['lastVisited'];
    createdAt = json['createdAt'];
    if (json['jobDetails'] != null) {
      jobDetails = <JobDetails>[];
      json['jobDetails'].forEach((v) {
        jobDetails!.add(new JobDetails.fromJson(v));
      });
    }
    applied = json['Applied'];
    hired = json['Hired'];
    shortlisted = json['Shortlisted'];
    invitation = json['invitation'];
    loader = false;
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['_id'] = this.id;
    data['jobType'] = this.jobType;
    data['title'] = this.title;
    if (this.jobLocation != null) {
      data['jobLocation'] = this.jobLocation!.toJson();
    }
    data['description'] = this.description;
    data['startDate'] = this.startDate;
    data['endDate'] = this.endDate;
    data['deadline'] = this.deadline;
    data['ageGroup'] = this.ageGroup;
    if (this.height != null) {
      data['height'] = this.height!.toJson();
    }
    data['gender'] = this.gender;
    data['lastVisited'] = this.lastVisited;
    data['createdAt'] = this.createdAt;
    if (this.jobDetails != null) {
      data['jobDetails'] = this.jobDetails!.map((v) => v.toJson()).toList();
    }
    data['Applied'] = this.applied;
    data['Hired'] = this.hired;
    data['Shortlisted'] = this.shortlisted;
    data['invitation'] = this.invitation;
    data['loader'] = this.loader;
    return data;
  }
}
